import React from "react";

class Users extends React.Component {
    users = [
        {
            id: 1,
            firstname: 'Tolya',
            lastname: 'Stepanov',
            bio: 'asd',
            age: 23,
            isHappy: true
        },
        {
            id: 2,
            firstname: 'Jora',
            lastname: 'Dedyukin',
            bio: 'qwe',
            age: 24,
            isHappy: false
        }
    ]
    render() {
        return (<div>
            {this.users.map((el) => (<div className="user">
                <h3>{el.firstname} {el.lastname}</h3>
                <p>{el.bio}</p>
                </div>))}
        </div>
        )
    }
}

export default Users
